legacy_mobile_2306 = {'affect_flags': [11], 'agility': 37, 'armor': 10, 'color_name': '|wM|Re|wc|Rh|n assualt |wS|xw|wa|xt|n unit', 'constitution': 45, 'desc': '   This large machine stands about ten feet tall. Two heavily built reverse\r\njointed legs holds this machine upright. Two huge barreled rifles are\r\npositioned on either side of its body. A small head looking piee sits on the\r\nforward part of its torso, a small red light bouncing between from side to side\r\nof its visor piece.\r\n', 'intelligence': 50, 'key': 'Mech assualt swat unit', 'ki': 6, 'mob_flags': [1, 3, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 2306, 'position': 8, 'race': 9, 'race_level': 55, 'room_description': 'A large Mech-Assualt unit with the words Swat painted on the side stands ready here.\r\n', 'sensei': 8, 'speed': 34, 'strength': 52, 'wisdom': 39, 'prototype_key': 'legacy_mobile_2306', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_2307 = {'agility': 11, 'armor': 10, 'color_name': 'Dazza and Shazza', 'constitution': 9, 'desc': "   Dazza is perched over the barbie, his hands striking with the swiftness of a\r\nred belly as he snaps his tongs, expertly shifting his snags before they can\r\nburn. A stubbie of VB is clutched tightly in his meaty fist, half of the\r\nbitter brew splashing onto the surface of the barbie and the rest down his\r\ngullet. \r\n\r\n   Shazza is by her husbands side, screeching like a galah about her one\r\nhundred percent genuine strayan goods, strutting like an emu towards anyone\r\nfoolish enough to look in the couple's general direction. She cackles like a\r\nkookaburra at potential customers terrible jokes, and pinches their children's\r\ncheeks. \r\n", 'intelligence': 18, 'key': 'dazza shazza', 'mob_flags': [1, 3, 18], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 2307, 'position': 8, 'race': 0, 'race_level': 10, 'room_description': "Dazza and Shazza are standing here flogging 'strayan food and goods.\r\n", 'sensei': 255, 'speed': 9, 'strength': 11, 'wisdom': 16, 'prototype_key': 'legacy_mobile_2307', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

