legacy_mobile_11401 = {'affect_flags': [11], 'agility': 10, 'armor': 10, 'color_name': '|cN|wi|cx|n', 'constitution': 20, 'desc': "   Standing nearly four and a half feet tall, this Icerian boy is the purest of\r\npure color of white. The Icerian's eyes are a soulless black. The domed\r\nsection of his head, shoulders, chest, and horns are an extremely dark ebony\r\ncolor, seeming to almost absorb the light around it. His short horns jut out\r\nfrom his head, ending in deadly sharp points. Around the domed section of his\r\nhead, a carapace protects his head, ending just at the brows, around the ears,\r\nand back of head. Besides his thick, strong tail, his thin body doesn't show\r\nmuch muscular build at all, as par normal for his race. His face is twisted\r\ninto a slight scowl more often than not, arms crossed behind his back quietly\r\nas he looks down on those around him.\r\n", 'intelligence': 14, 'key': 'Nix', 'ki': 4, 'mob_flags': [1, 3, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 11401, 'position': 8, 'race': 2, 'race_level': 20, 'room_description': '|cN|wi|cx|n, the leader of the invasion force, stands here ordering mutant soldiers around.\r\n', 'sensei': 6, 'sex': 1, 'speed': 20, 'strength': 17, 'wisdom': 17, 'prototype_key': 'legacy_mobile_11401', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

