legacy_mobile_13211 = {'affect_flags': [11, 24], 'agility': 18, 'armor': 10, 'color_name': '|rC|Ra|wr|Wn|xi|Rf|ri|We|wr|Rc|re|n', 'constitution': 16, 'desc': '   |wThe carnifierce is a large shark-like fish that is highly aggresive. One\r\nwould be hard pressed to find a bigger or meaner predator in the Namekian Ocean\r\nthan this creature. |n\r\n', 'intelligence': 8, 'key': 'Carnifierce', 'ki': 4, 'mob_flags': [3, 5, 25, 26], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 13211, 'position': 8, 'race': 15, 'race_level': 21, 'room_description': "A deadly carnifierce glides through the water here, hunting for it's next prey.\r\n", 'sensei': 255, 'sex': 1, 'size': 6, 'speed': 16, 'strength': 20, 'wisdom': 6, 'prototype_key': 'legacy_mobile_13211', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

