legacy_mobile_15031 = {'affect_flags': [11], 'agility': 9, 'armor': 10, 'color_name': '|wY|Wat|xa|wma|wri |MSucker|n', 'constitution': 11, 'desc': '   |wThe Yatamari sucker, is a strange animal that once lived in the wilds of\r\nKanassa. The four legged beasts would roam the ocean floors, sucking up the\r\ndead flesh of other ocean dwellers before they were driven to the brink of\r\nextinction. The city of Aquis has domesticated the Yatamari sucker and\r\nutilises it to keep the streets clean. |n\r\n', 'intelligence': 8, 'key': 'Yatamari Sucker', 'mob_flags': [3], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 15031, 'position': 8, 'race': 17, 'race_level': 2, 'room_description': "|WA |wY|Wat|xa|wma|wri |MSucker|n goes about it's business, cleaning the streets.\r\n", 'sensei': 255, 'sex': 1, 'speed': 6, 'strength': 16, 'wisdom': 8, 'prototype_key': 'legacy_mobile_15031', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

