legacy_mobile_15033 = {'affect_flags': [11], 'agility': 5, 'armor': 10, 'color_name': '|wKanassan Male|n', 'constitution': 9, 'desc': '   |wThis Kanassan is rather slender built, though that seems to be the norm for\r\nthe male citizens of this city. He is wearing a suit, albeit a casual one by\r\nEarth standards and appears to be in a bit of a hurry. |n\r\n', 'intelligence': 15, 'key': 'Kanassan male', 'mob_flags': [3], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 15033, 'position': 8, 'race': 6, 'race_level': 2, 'room_description': '|WA slender Kanassan male hurries down the street.|n\r\n', 'sensei': 255, 'sex': 1, 'speed': 16, 'strength': 16, 'wisdom': 10, 'prototype_key': 'legacy_mobile_15033', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

