legacy_mobile_15035 = {'affect_flags': [11], 'agility': 6, 'armor': 10, 'color_name': '|wKanassan Female|n', 'constitution': 8, 'desc': '   |wThis woman is dressed in rather smart attire, perhaps being someone of\r\nimportance or wanting to look the part. She appears to be in a hurry. |n\r\n', 'intelligence': 10, 'key': 'Kanassan Female', 'mob_flags': [3], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 15035, 'position': 8, 'race': 6, 'race_level': 2, 'room_description': '|WAn adult Kanassan hurries down the street.|n\r\n', 'sensei': 255, 'sex': 2, 'speed': 6, 'strength': 16, 'wisdom': 10, 'prototype_key': 'legacy_mobile_15035', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

