legacy_mobile_15058 = {'affect_flags': [11], 'agility': 31, 'armor': 10, 'color_name': '|WTuslo|n', 'constitution': 46, 'desc': '   |wThis short old wrinkly kanassan appears to be quite knowledgable about the\r\nhistories of the Temple and the kanassan people. |n\r\n', 'intelligence': 33, 'key': 'Tuslo Temple Historian', 'mob_flags': [1, 3], 'mob_specials': {'default_pos': 6}, 'mobile_vnum': 15058, 'position': 6, 'race': 6, 'race_level': 50, 'room_description': '|WTuslo the Temple Historian is sitting here reading an ancient book on kanassan languages.|n\r\n', 'sensei': 255, 'sex': 1, 'speed': 37, 'strength': 49, 'triggers': [15313, 15314, 15315], 'wisdom': 42, 'prototype_key': 'legacy_mobile_15058', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_15100 = {'affect_flags': [11, 24], 'agility': 19, 'armor': 10, 'color_name': '|WGiant Shrimp|n', 'constitution': 11, 'desc': "   |wThis large shrimp has grown to about three feet long. It uses it's many\r\nlegs and tail to swim around from rocky crag to rocky crag. |n\r\n", 'intelligence': 8, 'key': 'Giant Shrimp', 'mob_flags': [3, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 15100, 'position': 8, 'race': 15, 'race_level': 4, 'room_description': '|WA giant shrimp is swimming around here.|n\r\n', 'sensei': 255, 'sex': 2, 'size': 3, 'speed': 10, 'strength': 12, 'wisdom': 6, 'prototype_key': 'legacy_mobile_15100', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_15101 = {'affect_flags': [11, 24], 'agility': 13, 'armor': 10, 'color_name': '|WAn Amobite|n', 'constitution': 9, 'desc': '   |wThis creature is only native to Kanassa. It is similar to the common\r\njellyfish in substance but has an almost completely transparent body. Its body\r\nstructure tends to morph to whatever is most useful at the time as it tries to\r\nblend into its surroundings. |n\r\n', 'intelligence': 7, 'key': 'Amobite', 'mob_flags': [3, 23, 24], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 15101, 'position': 8, 'race': 15, 'race_level': 7, 'room_description': '|WAn amobite is floating around here trying to go unseen.|n\r\n', 'sensei': 255, 'sex': 1, 'size': 1, 'speed': 12, 'strength': 18, 'wisdom': 5, 'prototype_key': 'legacy_mobile_15101', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_15102 = {'affect_flags': [11, 24], 'agility': 18, 'armor': 10, 'color_name': '|WRock Trout|n', 'constitution': 18, 'desc': '   |wThis fish measures about four feet long and its body is covered in hard\r\nscales that resemble the rocks of this area. |n\r\n', 'intelligence': 6, 'key': 'Rock Trout', 'mob_flags': [3, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 15102, 'position': 8, 'race': 15, 'race_level': 5, 'room_description': '|WA rock trout is swimming cautiously here.|n\r\n', 'sensei': 255, 'sex': 1, 'size': 3, 'speed': 13, 'strength': 9, 'wisdom': 7, 'prototype_key': 'legacy_mobile_15102', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_15103 = {'affect_flags': [11, 24], 'agility': 17, 'armor': 10, 'color_name': '|WA Slyphorite|n', 'constitution': 11, 'desc': '   |wThis large crab-like creature can only be found on Kanassa. It has six long\r\nexoskeleton covered legs that it scurries around with and two stretchy tentecle\r\narms that it uses to grab prey with. This particular one has grown to measure\r\nten feet from legtip to legtip. |n\r\n', 'intelligence': 7, 'key': 'Slyphorite', 'mob_flags': [3, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 15103, 'position': 8, 'race': 15, 'race_level': 10, 'room_description': '|WA slyphorite is walking across the ocean floor here.|n\r\n', 'sensei': 255, 'sex': 2, 'size': 4, 'speed': 11, 'strength': 9, 'wisdom': 8, 'prototype_key': 'legacy_mobile_15103', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_15104 = {'affect_flags': [11, 24], 'agility': 20, 'armor': 10, 'color_name': '|WPearl Shark|n', 'constitution': 23, 'desc': "   |wThis large shark, which measures about twenty feet long, has a peculiar\r\nappearance to its skin. It's mostly blue skin sparkles when light catches it\r\nthanks to millions of tiny crystilline fragments that grow in it. The sparkle\r\nfrom these fragments is very similar to the appearance of a pearl and that is\r\nwhere this shark gets its name. |n\r\n", 'intelligence': 5, 'key': 'Pearl Shark', 'mob_flags': [3, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 15104, 'position': 8, 'race': 15, 'race_level': 25, 'room_description': '|WA pearl shark is swimming here slowly while searching for prey.|n\r\n', 'sensei': 255, 'sex': 1, 'size': 5, 'speed': 13, 'strength': 13, 'wisdom': 8, 'prototype_key': 'legacy_mobile_15104', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_15105 = {'affect_flags': [11, 24], 'agility': 18, 'armor': 10, 'color_name': '|WFlat Whale|n', 'constitution': 20, 'desc': "   |wThis hundred foot long whale is very different from any other known type of\r\nwhale. It's body is extremely thin from bottom to top. Compared to its length\r\nof about one hundred feet it only has a thickness of about five feet. It's\r\nentire body swims through the water in a ripling motion which helps it stir up\r\nthe microscopic food that it consumes regularly. |n\r\n", 'intelligence': 8, 'key': 'Flat Whale', 'mob_flags': [3, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 15105, 'position': 8, 'race': 15, 'race_level': 22, 'room_description': '|WA flat whale is swimming leisurely through the water here.|n\r\n', 'sensei': 255, 'sex': 2, 'size': 7, 'speed': 13, 'strength': 13, 'wisdom': 7, 'prototype_key': 'legacy_mobile_15105', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_15106 = {'affect_flags': [11, 24], 'agility': 19, 'armor': 10, 'color_name': '|WA Grand Amobite|n', 'constitution': 27, 'desc': '   |wThis is a gigantic version of the normal amobite. These amobites are rare\r\nand come about when a standard amobite managed to live for a long time and\r\ncontinue to grow. The usual cautious amobite becomes bolder as it outgrows its\r\nnatural predators. |n\r\n', 'intelligence': 8, 'key': 'Grand Amobite', 'mob_flags': [3, 23, 24], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 15106, 'position': 8, 'race': 15, 'race_level': 28, 'room_description': '|WA grand amobite is floating here with a half digested fish visible in its clear body.|n\r\n', 'sensei': 255, 'sex': 1, 'size': 5, 'speed': 26, 'strength': 25, 'wisdom': 6, 'prototype_key': 'legacy_mobile_15106', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_15107 = {'affect_flags': [11, 24], 'agility': 100, 'armor': 10, 'color_name': '|WThe |rD|Rreade|rd |MG|mr|wi|Wk|Mn|ma|wu|Wg|n', 'constitution': 100, 'desc': "   |wThis massive creature is shaped like the cross between a turtle and an\r\noctopus. It's shell is over a thousand feet across and it's tentcles are about\r\nthat length themselves. It has a total of six tentecles that stretch out of\r\nholes in its shell to snatch up whatever it decides to eat at any point in\r\ntime. Food is then handed to a mouth that it has on the bottom of its shell.\r\nThis mouth is protected by the shell most of the time but opens up to eat. No\r\neyes can be seen on the beast so it's not understood how it detects prey. All\r\nother animals of the ocean flee before its presence. |n\r\n", 'intelligence': 100, 'key': 'Dreaded Griknaug', 'mob_flags': [3, 23, 24, 25, 26], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 15107, 'position': 8, 'race': 15, 'race_level': 150, 'room_description': '|WThe |rd|Rreade|rd |MG|mr|wi|Wk|Mn|ma|wu|Wg is swimming slowly through the waters here.|n\r\n', 'sensei': 255, 'sex': 1, 'size': 8, 'speed': 79, 'strength': 77, 'wisdom': 59, 'prototype_key': 'legacy_mobile_15107', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_15200 = {'affect_flags': [11, 24], 'agility': 23, 'armor': 10, 'color_name': '|WA Cape Octopus|n', 'constitution': 22, 'desc': "   |wThis octopus is only about six feet in length, which doesn't give it a very\r\nintimidating size. It does however have razor sharp retractable spikes on the\r\nends of its tentecles that enable it to take down prey in a deadly manner. It\r\ngets its name from the way it hangs its rear tentecles when stalking a prey. \r\nLeaving them trailing out gently like a cape. |n\r\n", 'intelligence': 5, 'key': 'Cape Octopus', 'mob_flags': [3, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 15200, 'position': 8, 'race': 15, 'race_level': 30, 'room_description': '|WA cape octopus is swimming through the water here.|n\r\n', 'sensei': 255, 'sex': 1, 'size': 4, 'speed': 22, 'strength': 26, 'wisdom': 8, 'prototype_key': 'legacy_mobile_15200', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_15201 = {'affect_flags': [11, 24], 'agility': 32, 'armor': 10, 'color_name': '|WA Vespown|n', 'constitution': 30, 'desc': "   |wThis strange creature is only found in any form on Kanassa. It has six\r\nlimbs on a round body. On each limb is a clawed hand that allows it to kill\r\nprey and hang onto the rocks found in this part of the ocean. It's skin is\r\nmuch like shark skin and its round bulbous head with one eye is capable of\r\nsinking into its body for protection. |n\r\n", 'intelligence': 5, 'key': 'Vespown', 'mob_flags': [3, 21, 22, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 15201, 'position': 8, 'race': 15, 'race_level': 35, 'room_description': '|WA vespown is clinging to some rocks here.|n\r\n', 'sensei': 255, 'sex': 1, 'size': 4, 'speed': 18, 'strength': 34, 'wisdom': 5, 'prototype_key': 'legacy_mobile_15201', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_15202 = {'affect_flags': [11, 24], 'agility': 24, 'armor': 10, 'color_name': '|WA Cragmot|n', 'constitution': 25, 'desc': "   |wThis large creature has thousands of tiny legs underneath it that it moves\r\naround with. When it isn't moving it tries to mimic the nearby rocks and does\r\na passable job due to its rough shell. The only visible part of its body\r\noutside the shell other than its legs is its head which comes out when it feels\r\nsafe enough. When the head is out it quickly gathers up mouthfuls of whatever\r\nnearby plant it has targeted for consumption. |n\r\n", 'intelligence': 6, 'key': 'Cragmot', 'mob_flags': [3, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 15202, 'position': 8, 'race': 15, 'race_level': 30, 'room_description': '|WA cragmot is sitting here trying to look like a rock.|n\r\n', 'sensei': 255, 'sex': 1, 'size': 4, 'speed': 21, 'strength': 30, 'wisdom': 5, 'prototype_key': 'legacy_mobile_15202', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_15300 = {'affect_flags': [11, 24], 'agility': 20, 'armor': 10, 'color_name': '|GC|gav|Ge |CF|ci|ws|xh|n', 'constitution': 18, 'desc': '   |wThis fish is covered in tough glowing scales and stretches about four feet\r\nin length. Razor sharp teeth protrude from its bottom jaw. |n\r\n', 'intelligence': 6, 'key': 'Cave Fish', 'mob_flags': [3, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 15300, 'position': 8, 'race': 15, 'race_level': 22, 'room_description': '|WA |Gc|gav|Ge |Cf|ci|ws|xh|W is swimming around here.|n\r\n', 'sensei': 255, 'size': 3, 'speed': 22, 'strength': 11, 'wisdom': 5, 'prototype_key': 'legacy_mobile_15300', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_15301 = {'affect_flags': [11, 24], 'agility': 25, 'armor': 10, 'color_name': '|bW|Bate|br |CE|cl|xe|Cm|ce|xn|Ct|ca|xl|n', 'constitution': 31, 'desc': '   |wThis creature appears to be made out of water that has come to life. It is\r\nvery difficult to see when surrounded with other water that it can freely\r\nmanipulate. |n\r\n', 'intelligence': 35, 'key': 'Water Elemental', 'mob_flags': [1, 3, 21, 22, 23, 24, 25, 26], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 15301, 'position': 8, 'race': 23, 'race_level': 40, 'room_description': '|wA |bw|Bate|br |Ce|cl|xe|Cm|ce|xn|Ct|ca|xl|W is standing guard here.|n\r\n', 'sensei': 255, 'sex': 1, 'size': 4, 'speed': 27, 'strength': 35, 'triggers': [15300, 15301], 'wisdom': 37, 'prototype_key': 'legacy_mobile_15301', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_15302 = {'affect_flags': [11, 24], 'agility': 37, 'armor': 10, 'color_name': '|CI|cc|Ce |CE|cl|xe|Cm|ce|xn|Ct|ca|xl|n', 'constitution': 34, 'desc': '   |wThis creature appears to be made out of ice. How ice can live is not easily\r\nunderstood. Neither is why it would choose to live here.\r\n|n\r\n', 'intelligence': 35, 'key': 'Ice Elemental', 'mob_flags': [1, 3, 21, 22, 23, 24, 25, 26], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 15302, 'position': 8, 'race': 23, 'race_level': 40, 'room_description': '|WAn |CI|cc|Ce |CE|cl|xe|Cm|ce|xn|Ct|ca|xl|W is standing guard here.|n\r\n', 'sensei': 255, 'sex': 1, 'size': 4, 'speed': 21, 'strength': 40, 'triggers': [15302, 15303], 'wisdom': 39, 'prototype_key': 'legacy_mobile_15302', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_15303 = {'affect_flags': [11, 24], 'agility': 13, 'armor': 10, 'color_name': '|CI|cc|Ce |ySpirit|n', 'constitution': 13, 'desc': '   |wThis appears to be the ghost of a kanassan that is forever trapped in this\r\ncave. Why it is trapped in not easy to figure out. |n\r\n', 'intelligence': 22, 'key': 'Ice Spirit', 'mob_flags': [3, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 15303, 'position': 8, 'race': 23, 'race_level': 25, 'room_description': '|WAn |Ci|cc|Ce |yspirit|W is floating here with a horrified look on its face.|n\r\n', 'sensei': 255, 'sex': 1, 'size': 4, 'speed': 20, 'strength': 20, 'wisdom': 24, 'prototype_key': 'legacy_mobile_15303', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

