legacy_mobile_16322 = {'agility': 20, 'armor': 10, 'color_name': '|xP|Wr|ya|Yc|yt|wi|Wc|xe|y D|Yu|Wm|Ym|yy|n', 'constitution': 5, 'desc': "   This practice dummy looks well used, parts of it scorched and burned, the\r\nstuffing inside sticks out of a few places where it's been stabbed or slashed.\r\nThere's been a few attempts at sewing it back together, or patching it up, but\r\nit's a hard job to keep up with.\r\n", 'intelligence': 5, 'key': 'Practice Dummy', 'mob_flags': [1, 2, 3, 21, 22, 23, 24, 25, 29], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 16322, 'position': 8, 'race': 0, 'race_level': 10, 'room_description': 'A |xP|Wr|ya|Yc|yt|wi|Wc|xe|y D|Yu|Wm|Ym|yy|n, marred from combat damage, stands here.\r\n', 'sensei': 255, 'speed': 8, 'strength': 15, 'wisdom': 16, 'prototype_key': 'legacy_mobile_16322', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

