legacy_mobile_16333 = {'agility': 39, 'armor': 10, 'color_name': '|nGrizzly Smuggler|n', 'constitution': 31, 'desc': '|nThis grizzly looking character seems to be the epitome of what someone might\r\nthink a smuggler looks like. They pass by with a clear attempt to do anything\r\nbut draw attention to themselves. |n\r\n', 'intelligence': 32, 'key': 'smuggler human grizzly', 'ki': 4, 'mob_flags': [3, 11, 12, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 16333, 'position': 8, 'race': 0, 'race_level': 40, 'room_description': '|nA grizzly looking character passes by.|n\r\n', 'sensei': 255, 'sex': 1, 'speed': 31, 'strength': 29, 'wisdom': 27, 'prototype_key': 'legacy_mobile_16333', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_16400 = {'agility': 10, 'armor': 10, 'color_name': '|nFreshman student', 'constitution': 6, 'desc': "|nStanding here is a rather rotund looking student, dressed in |gexpensive|n clothing. Their posture is slumped and lazy, and the boy seems to spend most of his time looking down his nose at the other people around him. Lanky blond hair covers a thick forehead over a pudgy face, which pads his cheeks to give him beady looking eyes.\r\n \r\nThe boy's wide frame gives him almost a waddling gait as he moves, and his girth often strains the limits of the clothing he wears. Short, stubby legs give the young man a pear shape that will likely stick with him the remainder of his life. His expression is always sunder under his upturned nose and he oozes an air of entitlement.\r\n", 'intelligence': 6, 'key': 'freshman student rotund teenager', 'ki': 4, 'mob_flags': [2, 3, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 16400, 'money': 200, 'position': 8, 'race': 0, 'race_level': 10, 'room_description': '|nA rotund student stands here looking down his nose.\r\n', 'sensei': 255, 'sex': 1, 'speed': 13, 'strength': 7, 'wisdom': 18, 'prototype_key': 'legacy_mobile_16400', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_16401 = {'agility': 6, 'armor': 10, 'color_name': '|nFreshman student', 'constitution': 13, 'desc': 'This teenager is fairly skinny, |Rruddy|n-|rred|n pimples and acne all over his face. Too long hair flops over his down-cast eyes in an attempt to keep from having to make eyecontact with his fellow students. His arms are stuffed full of books, and he rushes to one of the classrooms, either to avoid bullies or to get to class on time.\r\n', 'intelligence': 20, 'key': 'freshman student acne teenager', 'mob_flags': [2, 3, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 16401, 'money': 100, 'position': 8, 'race': 0, 'race_level': 10, 'room_description': '|nAn |ra|R|wc|Rn|ne-riddled Freshman walks to class.|n\r\n', 'sensei': 255, 'sex': 1, 'speed': 7, 'strength': 18, 'wisdom': 14, 'prototype_key': 'legacy_mobile_16401', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_16402 = {'agility': 19, 'armor': 10, 'color_name': '|nFreshman student', 'constitution': 16, 'desc': '|nA slim, yet athletic looking tee ngirl is hurrying past on her way to class here. Of average height for a young girl her age, she manages to slip and slide her way past the other students in the hallways with ease. Slim shoulders lead to a small chest that leave her clothing looking a little baggy. She always has a rather distant look on her face, often dreaming of being anywhere else.\r\n', 'intelligence': 5, 'key': 'freshman student girl athletic slim teenager', 'mob_flags': [2, 3, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 16402, 'money': 50, 'position': 8, 'race': 0, 'race_level': 10, 'room_description': '|nA slim, athletic girl hurries past.\r\n', 'sensei': 255, 'sex': 2, 'speed': 11, 'strength': 16, 'wisdom': 15, 'prototype_key': 'legacy_mobile_16402', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_16403 = {'agility': 15, 'armor': 10, 'color_name': '|nSophmore student', 'constitution': 7, 'desc': "|nLoitering here is a grubby looking youth in his mid-teens. His clothing looks unwashed and grungy, and he covers this with a faded and cracked leather jacket. Unkempt hair tops off a look of apathy that doesn't lend much concern about his appearance.\r\n", 'intelligence': 16, 'key': 'sophmore student grubby teenager', 'mob_flags': [2, 3, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 16403, 'money': 100, 'position': 8, 'race': 0, 'race_level': 15, 'room_description': '|nA grubby looking student loiters here.|n\r\n', 'sensei': 255, 'sex': 1, 'speed': 14, 'strength': 15, 'wisdom': 18, 'prototype_key': 'legacy_mobile_16403', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_16404 = {'agility': 19, 'armor': 10, 'color_name': '|nSophmore student', 'constitution': 8, 'desc': '|nThis girl appears in her middle teens, flaunting a brazen outfit. She is |mscantily|n dressed in a faux school uniform of sorts that cover not nearly enough skin. She moves with a teasing fashion, and is never seen with books or backpack on their person.\r\n', 'intelligence': 8, 'key': 'sophmore student girl scantily teenager', 'mob_flags': [2, 3, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 16404, 'money': 100, 'position': 8, 'race': 0, 'race_level': 15, 'room_description': '|nA scantily dressed girl sashays through the hallway.\r\n', 'sensei': 255, 'sex': 2, 'speed': 10, 'strength': 7, 'wisdom': 13, 'prototype_key': 'legacy_mobile_16404', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_16405 = {'agility': 16, 'armor': 10, 'color_name': '|nSophmore student|n', 'constitution': 15, 'desc': "|nThis nondescript teenager is hard to keep an eye on. They simply breeze\r\nthrough the halls without really being noticed. Their features make it hard to\r\ndetermine if they're a boy or a girl, but of course it would be |rRUDE|n to ask. |n\r\n", 'intelligence': 15, 'key': 'sophmore student nondescript teenager', 'mob_flags': [2, 3, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 16405, 'money': 50, 'position': 8, 'race': 0, 'race_level': 15, 'room_description': '|nA nondescript student breezes through the halls.|n\r\n', 'sensei': 255, 'speed': 10, 'strength': 18, 'wisdom': 7, 'prototype_key': 'legacy_mobile_16405', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_16406 = {'agility': 18, 'armor': 10, 'color_name': '|nJunior student', 'constitution': 14, 'desc': '|nThis student is scrawny, with clothes that are just a little too large for him.\r\nHe walks through the hallways with an ease that suggests he knows just when the\r\nbells will ring, and has plenty of time to get to his next class. |n\r\n', 'intelligence': 12, 'key': 'junior student scrawny teenager', 'mob_flags': [2, 3, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 16406, 'money': 50, 'position': 8, 'race': 0, 'race_level': 20, 'room_description': '|nA scrawny boy in his late teens heads to class.|n\r\n', 'sensei': 255, 'sex': 1, 'speed': 16, 'strength': 14, 'wisdom': 18, 'prototype_key': 'legacy_mobile_16406', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_16407 = {'agility': 15, 'armor': 10, 'color_name': '|nJunior student|n', 'constitution': 12, 'desc': "|nThis girl is in her late teens, and has a lithe frame that curves down into long and slender legs. She doesn't seem to flaunt this like some of the other girls in the hallways, but rather tends to ignore the looks that it gets her. Dressed in modest yet stylish clothing, she hurries past all the students she doesn't know.\r\n", 'intelligence': 12, 'key': 'junior student leggy teenager girl', 'mob_flags': [2, 3, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 16407, 'money': 100, 'position': 8, 'race': 0, 'race_level': 20, 'room_description': '|nA leggy teen girl strolls by.|n\r\n', 'sensei': 255, 'sex': 2, 'speed': 16, 'strength': 16, 'wisdom': 10, 'prototype_key': 'legacy_mobile_16407', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_16408 = {'agility': 13, 'armor': 10, 'color_name': '|nJunior student|n', 'constitution': 15, 'desc': '|nThis burly teen is likely in his last years of highschool, and wears an athletic jersey for the |yOrange Star|n football team. His backpack allways carries the tell-tale bulge of a soccer ball.\r\n', 'intelligence': 15, 'key': 'junior student brawny teenager jersey', 'mob_flags': [2, 3, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 16408, 'money': 50, 'position': 8, 'race': 0, 'race_level': 20, 'room_description': '|nA brawny teen in a jersey walks by.|n\r\n', 'sensei': 255, 'sex': 1, 'speed': 14, 'strength': 17, 'wisdom': 14, 'prototype_key': 'legacy_mobile_16408', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_16409 = {'agility': 12, 'armor': 10, 'color_name': '|nSenior student|n', 'constitution': 17, 'desc': "|nThis is a senior student, bulky in the shoulders and at the hip. He walks\r\nthrough the hallways as if ready to leave this place, or perhaps afraid to. \r\nReal life looms over the student's head and it's palpable. |n\r\n", 'intelligence': 14, 'key': 'senior student bulky teenager', 'mob_flags': [2, 3, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 16409, 'money': 50, 'position': 8, 'race': 0, 'race_level': 25, 'room_description': '|nA bulky student nearing adulthood walks here.|n\r\n', 'sensei': 255, 'sex': 1, 'speed': 16, 'strength': 24, 'wisdom': 15, 'prototype_key': 'legacy_mobile_16409', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_16410 = {'agility': 24, 'armor': 10, 'color_name': '|nSenior student|n', 'constitution': 25, 'desc': "|nThis girl is in her late teens, and looks absolutely stressed out. Her clothes\r\nare mis-matched and based on the hurried pace of her posture she never seems to\r\nbe on time. She barely looks at the people she's passing by. |n\r\n", 'intelligence': 24, 'key': 'senior student stressed chick girl teenager', 'mob_flags': [2, 3, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 16410, 'money': 50, 'position': 8, 'race': 0, 'race_level': 25, 'room_description': '|nA stressed out looking chick is walking by.|n\r\n', 'sensei': 255, 'sex': 2, 'speed': 24, 'strength': 13, 'wisdom': 15, 'prototype_key': 'legacy_mobile_16410', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

legacy_mobile_16411 = {'agility': 13, 'armor': 10, 'color_name': '|nSenior student|n', 'constitution': 16, 'desc': '|nThis student is clearly an athlete in his senior year. He sports a Kendo club\r\njacket over his usual school attire and walks with the confidence that comes\r\nfrom regular practice and natural talent. |n\r\n', 'intelligence': 20, 'key': 'senior student', 'mob_flags': [2, 3, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 16411, 'money': 30, 'position': 8, 'race': 0, 'race_level': 25, 'room_description': '|nAn athlete student stands here in a club jacket.|n\r\n', 'sensei': 255, 'sex': 1, 'speed': 20, 'strength': 13, 'wisdom': 18, 'prototype_key': 'legacy_mobile_16411', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

