legacy_mobile_63227 = {'affect_flags': [11], 'agility': 68, 'armor': 10, 'color_name': '|xZa|wnn|xa', 'constitution': 80, 'desc': '   This mutant looks young maybe sixteen, standing at about five seven. Her\r\neyes are bright yellow, her skin pale white. She has long black hair with a\r\nsolid white streak that falls in front of her face, its almost looks frizzy as\r\nif it were unkept. Her body is ample, toned, though still very petite looking.\r\n', 'intelligence': 73, 'key': 'Mutant Zanna', 'ki': 10, 'mob_flags': [1, 3, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 63227, 'position': 8, 'race': 5, 'race_level': 95, 'room_description': 'A petite looking mutant stands here.\r\n', 'sensei': 5, 'sex': 2, 'speed': 85, 'strength': 49, 'wisdom': 82, 'prototype_key': 'legacy_mobile_63227', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

