legacy_mobile_63230 = {'affect_flags': [11], 'agility': 8, 'armor': 10, 'color_name': '|rT|wyr|ri|n', 'constitution': 6, 'desc': '   With silver hair, silver fur on her tail, and silver eyes, Tyri is a few\r\ninches taller than the average eight year old, but is a little under weight as\r\nwell. Her slight stature is owing to her time in captivity in the slave\r\nmarkets on Frigid where malnourishment and physical abuse were commonplace, and\r\nno ammount of her budding saiyan apatite has yet put the meat back on her\r\nbones, though she has fleshed out a bit since she was rescued. She wears a\r\nfairly simple set of clothing though the styles vary from different worlds as\r\nthe four people who look after her all have different fashion senses, though\r\nshe does not seem to mind the odd assortment. She has an easy smile and a\r\ndelightful manner, though it sometimes spoiled slightly by a sharp wit and\r\ntongue owing to her adopted aunt.\r\n', 'intelligence': 10, 'key': 'Saiyan Tyri girl silver', 'ki': 4, 'mob_flags': [1, 3, 21, 22, 23, 24, 25], 'mob_specials': {'default_pos': 8}, 'mobile_vnum': 63230, 'position': 8, 'race': 7, 'race_level': 1, 'room_description': 'A young, half-Saiyan girl with silver hair stand here.\r\n', 'sensei': 0, 'sex': 2, 'speed': 14, 'strength': 7, 'wisdom': 12, 'prototype_key': 'legacy_mobile_63230', 'prototype_parent': 'formless_mobile', 'prototype_tags': ['legacy_mobile', 'legacy']}

